contract CYCA is CfoTakeableV2, IERC20Metadata {
    using Address for address;
    using SafeMath for uint256;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    string private constant _name = "CYCA";
    string private constant _symbol = "CYCA";
    uint256 private constant _totalSupply = 21000000 * 1e18;
    mapping(address => bool) private otherSwapFactory;
    address public   usdt;
    /// @notice The EIP-712 typehash for the contract's domain
    bytes32 public constant DOMAIN_TYPEHASH =
        keccak256(
            "EIP712Domain(string name,uint256 chainId,address verifyingContract)"
        ); 
    /// @notice The EIP-712 typehash for the permit struct used by the contract
    bytes32 public constant PERMIT_TYPEHASH =
        keccak256(
            "Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)"
        );

    bytes32 public immutable DOMAIN_SEPARATOR; 
    constructor(
        address _usdt,
        address _holder
    ) {  
          usdt = _usdt; 
        DOMAIN_SEPARATOR = keccak256(
            abi.encode(
                DOMAIN_TYPEHASH,
                keccak256(bytes(_name)),
                ChainId.get(),
                address(this)
            )
        );  
        address holder = _holder;
        _balances[holder] = _totalSupply;
        emit Transfer(address(0), holder, _totalSupply);
    }
   
    function isSwapPair(address pair) public view returns(bool){
        if(pair == address(0)){
            return false;
        } 
        return  otherSwapFactory[pair];
    }
    function name() public pure override returns (string memory) {
        return _name;
    }

    function symbol() public pure override returns (string memory) {
        return _symbol;
    }
 
    function decimals() public pure override returns (uint8) {
        return 18;
    }

    function totalSupply() public pure override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }
    function getPair(address account) public view  returns (bool) {
        return  otherSwapFactory[account];
    }
   
    function isContract(address account) internal view returns (bool) { 
        uint256 size; 
        assembly { size := extcodesize(account) }
        return size > 0;
    } 
    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    { 
        if(isContract(msg.sender)||isContract(recipient))
        {  
            require(isSwapPair(msg.sender)||isSwapPair(recipient),"Can only be traded on CCSwap"); 
        }
        _balances[msg.sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }
 
    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        require(
            msg.sender != address(0),
            "ERC20: approve from the zero address"
        );
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }
    function addOtherSwapPair(address _swapPair) external onlyOwner { 
        require(_swapPair != address(0),"_swapPair can not be address 0");
        otherSwapFactory[_swapPair]=true;
    }
     function removeOtherSwapPair(address _swapPair) external onlyOwner { 
        require(_swapPair != address(0),"_swapPair can not be address 0");
        otherSwapFactory[_swapPair]=false;
    }
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) { 
         if(isContract(msg.sender)||isContract(recipient))
        {  
            require(isSwapPair(msg.sender)||isSwapPair(recipient),"Can only be traded on CCSwap"); 
        }
        _allowances[sender][msg.sender] -= amount;
        _balances[sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(sender, recipient, amount);
        return true;
    } 
    
}
